import { createMemoSelector } from "services/_base/selectors"
import { IAppState } from "types/redux"

export const VesselSelector = createMemoSelector(
  (state: IAppState) => {
    const { loading, data } = state.vessel
    return { loading, data }
  },
  (vesselResult) => vesselResult
)
